import "../css/Social.css";
import Post from "./Post";
import ImgUpload from "./ImgUpload";
import logo from "../images/pawprint_logo.png";
import cat_img from "../images/social/powell_cat_image.jpeg";
import { NavLink } from "react-router-dom";
import Axios from 'axios';

function Social() {
  // const [post1, setPost1] = useState([]);

  // const post1 = () => {
  //   Axios.get("http://localhost:3001/upload/like", {
  //     userLiking: localStorage.getItem("username"),
  //     postId: id,
  //   }).then((response) => {
  //     setPost1(tempLikes);
  //   });
  // }; 
  function ImgUpload() {
    return (
      <div className="ImgUpload">
        <label>Say something:</label>
        <input type="text" />
        <input type="file" />
        <label for="pet-select">Choose a tage for your animal:</label>

        <select name="pets" id="pet-select">
          <option value="">--Please choose an option--</option>
          <option value="dog">Dog</option>
          <option value="cat">Cat</option>
          <option value="squirrel">Squirrel</option>
          <option value="bird">Bird</option>
          <option value="bunny">Bunny</option>
          <option value="others">Others</option>
        </select>
        <button>Submit</button>
      </div>
    );
  }

  return (
    <div className="App">
      <select name="pets" id="pet-select">
        <option value="">--Please choose an option--</option>
        <option value="dog">Dog</option>
        <option value="cat">Cat</option>
        <option value="squirrel">Squirrel</option>
        <option value="bird">Bird</option>
        <option value="bunny">Bunny</option>
        <option value="others">Others</option>
      </select>
      <button className="select">select</button>
      <div className="postbutton">
        <NavLink class="nav-link" to="/create">
          <button>Post</button>
        </NavLink>
      </div>
      <ul>
        {/*will display latest 10 posts*/}
        <li>
          <Post
            username="adithi.ramesh02"
            caption="So Cute!!"
            image={cat_img}
            tag="cat"
          />
        </li>
        <li>
          <Post
            username="adithi.ramesh02"
            caption="So Cute!!"
            image={cat_img}
            tag="cat"
          />
        </li>
      </ul>
    </div>
  );
}

export default Social;
